function App() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to='/'>Inicio</Link>
          </li>
          <li>
            <Link to="">Contaco</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
